import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/job-board">Job Board</Link>
          </li>
          <li>
            <Link to="/applied-jobs">Applied Jobs</Link>
          </li>
          <li>
            <Link to="/my-profile">My Profile</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default NavBar;
